  false,\n\t\"url\": null,\n\t\"notes\": \"This point data set contains streamflow-measurement
  sites in the Elkhorn and Loup River basins and selected streamflow-measurement sites
  in the Niobrara and Platte River basins in north-central Nebraska. At these 531
  sites, flows ranging from no flow to 2,600 cubic feet per second were measured or
  observed during November 8 to 21, 2006. Measurements were made by several different
  methods, including current meters, flumes, and acoustic Doppler velocimeters. Each
  measurement site location was recorded using a handheld global positioning system
  (GPS) unit and then downloaded and stored in a computer spreadsheet. Stored coordinates
  were used to produce point features in GIS native format.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
